    function(layer){
    let div = L.DomUtil.create('div');
    
    let handleObject = feature=>typeof(feature)=='object' ? JSON.stringify(feature) : feature;
    let fields = ["flight_number", "flight_iata", "dep_iata", "arr_iata", "airline_icao", "aircraft_icao", "status"];
    let aliases = ["flight_number", "flight_iata", "dep_iata", "arr_iata", "airline_icao", "aircraft_icao", "status"];
    let table = '<table>' +
        String(
        fields.map(
        (v,i)=>
        `<tr>
            <th>${aliases[i].toLocaleString()}</th>
            
            <td>${handleObject(layer.feature.properties[v]).toLocaleString()}</td>
        </tr>`).join(''))
    +'</table>';
    div.innerHTML=table;
    
    return div
    }
